import {Container, HeaderChess} from '../style/style'
import Image from 'next/image'


function Home () {
    return (
        <Container>
            <HeaderChess>
                {/* <ContorImageChess> */}
                    <Image quality="100" responsive="true" width="1000" height="500" src="/chess.webp"/>
                {/* </ContorImageChess> */}
            </HeaderChess>
        </Container>
    )
}

export default Home
